import {imgCertificates} from '../../assets/certificates/imgCertificates.js';


function Item({image,description}){
    return(
        <li>
            <img src={image} alt={description}/>
        </li>
    );
}


function Certificate (){
    return(
        <section className='section-home'>
            <ul>
                {
                    imgCertificates.map(img => (
                        <Item
                        key={img.img}
                        image={img.img}
                        description={img.alt}
                        />
                    ))
                }

            </ul>
        </section>
    );
}

export {Certificate};
